import BlogData from '../../BlogData';
import BlogItem from '../BlogItem/BlogItem';

function Blog() {
    console.log(BlogData);
    return (

        <div>This is a Blog
            <section>
                {BlogData.map((dataItem, index) => {
                    return (
                        <BlogItem name={dataItem.title} img={dataItem.img_url} key={index} pageNumber={index} />
                    );
                })}
            </section>
        </div>
    );
}

export default Blog;
